"use client";

import axios from 'axios';
import { useEffect, useState } from 'react';
import Modal from 'react-modal';

Modal.setAppElement('#root');

interface GetRoomInfo {
    room: Room;
    status: string;
}

interface Room {
  room_number: string;
  floor: number;
  room_type_id: number;
}

interface RoomData {
    [key: string]: GetRoomInfo;
}

const statusColors = {
    available: '#00FF00',
    confirmed: '#FFFF00',
    checked_in: '#FF0000'
};

export default function FirstFloorMap() {
    const [rooms, setRooms] = useState<RoomData>({});
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState<string | null>(null);
    const [selectedRoom, setSelectedRoom] = useState<GetRoomInfo | null>(null);
    const [modalIsOpen, setModalIsOpen] = useState(false);

    useEffect(() => {
        const fetchAllRooms = async () => {
            try {
                const token = localStorage.getItem('authToken');
                if (!token) {
                    throw new Error('No authentication token found');
                }

                const roomIds = ['101', '102', '103', '104', '105', '106', '107', '108'];
                const roomPromises = roomIds.map(async (id) => {
                    const response = await axios.get<GetRoomInfo>(
                        `http://localhost:8080/v1/hotel/rooms/${id}`,
                        { headers: { 'Authorization': `Bearer ${token}` } }
                    );
                    return { [id]: response.data };
                });

                const roomResults = await Promise.all(roomPromises);
                const roomData = roomResults.reduce((acc, curr) => ({ ...acc, ...curr }), {});
                
                setRooms(roomData);
                setLoading(false);
            } catch (error) {
                console.error('Error fetching room info:', error);
                setError('Failed to load room information');
                setLoading(false);
            }
        };

        fetchAllRooms();
    }, []);
    
  const handleClick = async (e: React.MouseEvent<SVGSVGElement>) => {
        const target = e.target as SVGElement;
        const id = target.id;

        if (id.startsWith('room_')) {
            const roomId = id.replace('room_', '');
            
            try {
                const token = localStorage.getItem('authToken');
                if (!token) throw new Error('No authentication token found');

                const response = await axios.get<GetRoomInfo>(
                    `http://localhost:8080/v1/hotel/rooms/${roomId}`,
                    { headers: { 'Authorization': `Bearer ${token}` } }
                );

                setSelectedRoom(response.data);
                setModalIsOpen(true);
            } catch (error) {
                console.error('Error fetching room info:', error);
                setError('Failed to load room details');
            }
        }
    };

    const closeModal = () => {
        setModalIsOpen(false);
        setSelectedRoom(null);
    };

const getRoomColor = (roomId: string) => {
    if (!rooms[roomId]) return 'white';
    return statusColors[rooms[roomId].status] || 'white';
};

    return (
    <div style={{ position: 'relative' }}>
      <svg width="687" height="450" viewBox="0 0 687 450" fill="none" xmlns="http://www.w3.org/2000/svg" onClick={handleClick} >
        <g id="1 floor">
            <rect width="687" height="450" fill="white"/>
            <rect id="building" x="31.5" y="43.5" width="624" height="362" fill="white" stroke="black"/>
            <rect id="room_101" x="53.5" y="71.5" width="81" height="81" fill={getRoomColor('101')} stroke="black"/>
            <rect id="room_102" x="53.5" y="309.5" width="81" height="81" fill={getRoomColor('102')} stroke="black"/>
            <rect id="room_103" x="189.5" y="309.5" width="81" height="81" fill={getRoomColor('103')} stroke="black"/>
            <rect id="room_104" x="325.5" y="309.5" width="81" height="81" fill={getRoomColor('104')} stroke="black"/>
            <rect id="room_105" x="461.5" y="309.5" width="81" height="81" fill={getRoomColor('105')} stroke="black"/>
            <rect id="room_106" x="461.5" y="71.5" width="81" height="81" fill={getRoomColor('106')} stroke="black"/>
            <rect id="room_107" x="189.5" y="71.5" width="81" height="81" fill={getRoomColor('107')} stroke="black"/>
            <rect id="room_108" x="325.5" y="71.5" width="81" height="81" fill={getRoomColor('108')} stroke="black"/>
            <rect id="enter/exit" x="617" y="206" width="38" height="38" fill="url(#pattern0_1_2)"/>
        </g>
        <defs>
            <pattern id="pattern0_1_2" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use href="#image0_1_2" transform="scale(0.000892857)"/>
            </pattern>
            <image id="image0_1_2" data-name="image.png" width="1120" height="1120" preserveAspectRatio="none" href="data:image/png;base64,"/>
        </defs>
    </svg>

    <Modal
                isOpen={modalIsOpen}
                onRequestClose={closeModal}
                contentLabel="Room Information"
                style={{
                    content: {
                        top: '50%',
                        left: '50%',
                        right: 'auto',
                        bottom: 'auto',
                        marginRight: '-50%',
                        transform: 'translate(-50%, -50%)',
                        width: '300px',
                        padding: '20px',
                        borderRadius: '8px',
                        boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
                    },
                    overlay: {
                        backgroundColor: 'rgba(0, 0, 0, 0.5)'
                    }
                }}
            >
                {selectedRoom && (
                    <div>
                        <h2>Room {selectedRoom.room.room_number}</h2>
                        <p><strong>Floor:</strong> {selectedRoom.room.floor}</p>
                        <p><strong>Type ID:</strong> {selectedRoom.room.room_type_id}</p>
                        <p><strong>Status:</strong> {selectedRoom.status}</p>
                        <button 
                            onClick={closeModal}
                            style={{
                                marginTop: '15px',
                                padding: '8px 16px',
                                backgroundColor: '#f0f0f0',
                                border: '1px solid #ddd',
                                borderRadius: '4px',
                                cursor: 'pointer'
                            }}
                        >
                            Close
                        </button>
                    </div>
                )}
            </Modal>

            {loading && <div>Loading room information...</div>}
            {error && <div style={{ color: 'red' }}>{error}</div>}
    </div>
    )
};
